import message from './Dialogs.module.css';
import {NavLink} from 'react-router-dom';


function DialogItem(props) {
    let path = "/dialogs/" + props.id;
    return (
        <div className={message.dialogs_item}>
            <NavLink to={path}>{props.name}</NavLink>
        </div>
    );
}

function Message(props) {
    return(
        <div className={message.message_item}>{props.content}</div>
    );
}

let dialogsData = [
    {id: 1, name: "Dimych",},
    {id: 2, name: "Evgeniy",},
    {id: 3, name: "Sasha",},
]

let messagesData = [
    {id: 1, message: "Hello",},
    {id: 2, message: "How are you?",},
    {id: 3, message: "Chel",},
]

function Dialogs() {
    return(
        <div className={message.dialogs}>
            <div className={message.notify}>
                    <DialogItem name={dialogsData[0].name} id={dialogsData[0].id}/>
                    <DialogItem name={dialogsData[1].name} id={dialogsData[2].id}/>
                    <DialogItem name={dialogsData[2].name} id={dialogsData[2].id}/>
            </div>
            <div className={message.paper_dial}>
                <Message content={messagesData[0].message} id={messagesData[0].id}/>
                <Message content={messagesData[1].message} id={messagesData[2].id}/>
                <Message content={messagesData[2].message} id={messagesData[2].id}/>
            </div>
        </div>
    );
}

export default Dialogs
